      out.write("            <p style=\"font-family: \" microsoft=\"\" margin-top:=\"\" margin-bottom:=\"\" padding:=\"\" color:=\"\" font-size:=\"\" white-space:=\"\" background-color:=\"\">　好好吃饭介绍</p>\r\n");
      out.write("            <p style=\"font-family: \" microsoft=\"\" margin-top:=\"\" margin-bottom:=\"\" padding:=\"\" color:=\"\" font-size:=\"\" white-space:=\"\" background-color:=\"\">　　 连锁创办于1999年，是一家经营特色湘菜为主的餐饮连锁企业，其经营范围包括风味饮食与餐饮管理等。为进一肯推动湘菜的发展，传播湘菜文化，迎合众多喜爱湘菜的美食家和消费者的需求，回家吃饭人经过十年的努力，本着“诚信、务实、创新、服务”的经营理念，以美味的产品、稳定的品质、热情的服务、欢乐的笑容、亲切的招呼，赢得了无数消费者的心，同时也在珠三角赢取了强而稳定的市场，拥有了良好的口碑。 回家吃饭餐饮连锁作为一家正处于迅速成长中的民营餐饮企业，在企业发展的过程中，不断吸取先进的管理理念，管理模式由粗放、作坊式向规范化、现代化转变。“以人为本、诚信服务”是回家吃饭人始终不渝的追求，在经营管理过程中，始终秉承“顾客就是”“员工就是家人”的理念，积极营造以人性化管理为核心的企业文化，并贯穿工作始终！ 随着餐饮行业的持续发展，回家吃饭人开始重视品牌优势的塑造，注重利用连锁经营进行扩张，做好成本控制，建立科学规范的管理体系，搞好企业文化的渗透，以使回家吃饭的餐饮特色深入人心，传递特色湘菜的品牌魅力，使企业做强、做大！ 家的感觉，妈妈的味道，回家吃饭为你实现！ 　　随着中餐行业的快速发展，人们对品质的要求越来越高，行业之间竞争也是越来越激烈，因而，许多的投资者们就选择了通过加盟优质品牌来减缓自己的创业压力，而投资者们更为青睐的品牌就是回家吃饭餐饮连锁。价廉物美可满足不同喜好消费者的需要，市场销量不断提高，同时门店业绩也逐步提升。为了适应市场需要，现在全国范围内招募经销商，一系列加盟优势和加盟支持助您轻松创业，快速致富。对中餐行业感兴趣的您，选择加盟回家吃饭餐饮连锁是明智的选择，会让您赚的盆满钵满。千万不要把机会留给了别人，赶紧行动起来吧！\r\n");
